import React from "react";
import logo from "./images/logo.png";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <div className="header">
        <div className="container">
          <div className="logo">
            <a href="">
              <img src={logo} />
            </a>
          </div>
          <div className="nav_links">
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default Navbar;
